import "./App.css";
import "./index.css";
import Card from "./components/Card";
import splash1 from "./assets/image.jpg";
import splash2 from "./assets/image2.jpg.jpg";

function App() {
  return (
    <div>
      <Card imageSrc={splash1} />
      <Card imageSrc={splash2} />
    </div>
  );
}

export default App;
